  selector: 'app-single',
  templateUrl: './single.component.html',
  styleUrls: ['./single.component.scss'],
})
export class SingleComponent {
  sheep: SheepDetailed = 
  
  
  {
    title: 'I am a sheep',
    name: 'Wooly',
